import './index.css'
import {Component} from 'react'

class Appointments extends Component {
  render() {
    return (
      <div>
        <div>
          <div className="text-container">
            <h1>Appointments</h1>
          </div>
          <div className="img-container">
            <img />
          </div>
        </div>
      </div>
    )
  }
}

export default Appointments
